import React from "react";
import Table from "./components/Table";

function App() {
  const data = [
    { ip: "192.168.0.1", duration: "10ms", time_attempt: "12:00" },
    { ip: "192.168.0.2", duration: "15ms", time_attempt: "12:05" },
    { ip: "192.168.0.3", duration: "20ms", time_attempt: "12:10" },
  ];
  return <div className="App">
    <Table rows={data}/>
  </div>
}

export default App;
